import { Col, Container } from "react-bootstrap";

function CatalogModal(){
    const ArraysOfModal = [{
        id: 1,

    }]
    const ArraysOfModalOnMap = ArraysOfModal.map((ArrayOfModal) => 
    <>
    <Container key = {ArrayOfModal.id}>
        <div className="modalTitle">

        </div>
    </Container>
    </>
    ) 

    return(
        <Container>
            {ArraysOfModalOnMap}
        </Container>
    )
}

export default CatalogModal
